export class ProductItem {
	nom : string;
	url : string;
	description : string;
	prix : number;
	disponibilite : boolean;

  constructor(nom: string, url: string, description: string, prix: number, disponibilite: boolean) {
    this.nom = nom;
    this.url = url;
    this.description = description;
    this.prix = prix;
    this.disponibilite = disponibilite;
  }
}
